Quick change filter series FQ1 requires no tools for  replacement of the element.  Element replacement, including removing liquid, can be accomplished in less than 2 minutes. Element sizes include 125mm, 250mm and 500mm.  Materials  include PP, cotton, SUS304 (epoxy resin) and SUS316 (nickel solder).  Other elements are available as made-to-order.
